import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View,Image } from 'react-native';
import Usuario from './src/Usuario';
import imagen from './assets/cart-icon-28356.png'
import { TextInput } from 'react-native-web';

export default function App() {
  return (
   <View style={{flex:1}}>
    <View style={{flexDirection:'row', justifyContent:'center', gap:8,alignItems:'center', marginTop:'10%'}}>
      <Text>MyStore</Text>
      <Image source={imagen} style={{width:50, height:50}}></Image>
    </View>
      <TextInput/>
      <Text>Celulares</Text>
      <Text>SmartWatch</Text>
      <Text>Notebook</Text>
   </View>
  );
};
